import React from 'react';
import { RiSearch2Line } from "react-icons/ri";

const StepOne = () => {
    return (
        <div>
            <h3 className="mb-5 text-lg font-medium text-gray-900 dark:text-white">Bạn là?</h3>
            <ul className="grid w-full gap-6 md:grid-cols-2">
                <li>
                    <input type="radio" id="role-tenant" name="role" value="" className="hidden peer" required />
                    <label for="role-tenant" className="inline-flex items-center justify-between w-full p-5 text-gray-500 bg-white border border-gray-200 rounded-lg cursor-pointer dark:hover:text-gray-300 dark:border-gray-700 dark:peer-checked:text-blue-500 peer-checked:border-blue-600 peer-checked:text-blue-600 hover:text-gray-600 hover:bg-gray-100 dark:text-gray-400 dark:bg-gray-800 dark:hover:bg-gray-700">
                        <div className="block">
                            <RiSearch2Line size="35"></RiSearch2Line>
                            <div className="w-full text-2xl font-bold mt-3">Người tìm trọ</div>
                        </div>
                    </label>
                </li>
                <li>
                    <input type="radio" id="role-landlord" name="role" value="" className="hidden peer" />
                    <label for="role-landlord" className="inline-flex items-center justify-between w-full p-5 text-gray-500 bg-white border border-gray-200 rounded-lg cursor-pointer dark:hover:text-gray-300 dark:border-gray-700 dark:peer-checked:text-blue-500 peer-checked:border-blue-600 peer-checked:text-blue-600 hover:text-gray-600 hover:bg-gray-100 dark:text-gray-400 dark:bg-gray-800 dark:hover:bg-gray-700">
                        <div className="block">
                            <div className="w-full text-lg font-bold">Chủ trọ</div>
                            <div className="w-full">Good for large websites</div>
                        </div>
                    </label>
                </li>
            </ul>
        </div>
    );
};

export default StepOne;
